import React from 'react';
import ReactDOM from 'react-dom/client'; // createRoot를 가져옵니다.
import App from './App';
import './index.css';

const root = ReactDOM.createRoot(document.getElementById('root')); // root element를 가져옵니다.
root.render(<App />); // render 함수를 createRoot로 대체합니다.
